import styled from "@emotion/styled";

export const TodayStudyContainer = styled.div`
  display: flex;
  width: 100%;
  height: 8rem;
  padding-top: 8rem;
`;

export const TodayStudy = styled.div`
  width: 100%;
`;

export const TodayStudyTextBig = styled.div`
  color: black;
  font-size: 3.5rem;
  padding-bottom: 2rem;
`;

export const TodayStudyTextsm = styled.div`
  color: black;
  font-size: 1.2rem;
`;

export const TodayStudyTextsmRight = styled.div`
  color: black;
  font-size: 1.2rem;
  padding-left: 50%;
`;

export const TextContainer = styled.div`
  display: flex;
`;
